    return (
        <div className = 'columns'> 
        <div class = 'column'>
            <div className="card">
            <div className="card-image">
            <figure className="image is-48x48">
                <img src={props.image}/>
                </figure>
            </div>
            <div class="media-content">
            <div> {props.title}</div>
            <div> {props.handle}</div>
      </div>
    </div>
    </div>
    </div>
    );

}
